import React, { Component } from 'react'
import Select from 'react-select'
import { Radio } from '@/components/radio'
import { ColoredButtons } from '@/components/button/index'
import './index.scss'

class CreateRuleImport extends Component {
    state = {
        addProperty: false,
    }
    render() {
        return (
            <div className="section mrgn-top-15">
                <div
                    className="flex"
                    style={{
                        alignItems: 'center',
                    }}
                >
                    <ColoredButtons className="width-150">Add Property</ColoredButtons>
                    <ColoredButtons className="width-150">Add Actions</ColoredButtons>
                    <Select className="width-150" placeholder="Select App" />
                </div>
            </div>
        )
    }
}

export default CreateRuleImport
